import React,{useState, useEffect} from "react";
import imagen1 from "../resourses/imagen.jpg"
import "./WeatherCard.css"

export default function WeatherCard(props){
  const [cityData, setCityData] = useState(props)
  const [weatherForecast, setWeatherForecast] = useState([])
  useEffect(() => {
    const callWeatherForecast = async(cityData) => {
      cityData.data.forEach( async(el) => {
        let res = await fetch(`http://api.weatherapi.com/v1/current.json?key=c156f7f2a3d84ae0861121630223006&q=${el}&aqi=no`)
        console.log(res.json())})}

    callWeatherForecast(cityData)
  }, []);



  return(
    <div className="cards">     
      <div class="card" style={{width: "18rem"}}>
        <img src={imagen1} class="card-img-top" alt="..."/>
          {console.log(cityData)}
          <div class="card-body">
            {cityData.data.map((el)=> (
              <div>                
                <h5 class="card-title" key={el}>{el}</h5>
                <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
              </div>
            ))}
          </div>
      </div>
    </div>
  )
}
